import React, { useState, useEffect } from 'react';

const PET_API = 'http://localhost:8090/bd_petcare/api/pets';
const OWNER_BY_USER_API = 'http://localhost:8090/bd_petcare/api/owners/user';

function PetForm() {
  const [formData, setFormData] = useState({
    name: '',
    species: '',
    breed: '',
    birthDate: '',
    owner: {
      ownerId: ''
    }
  });

  const [successMessage, setSuccessMessage] = useState('');
  const [errorMessage, setErrorMessage] = useState('');

  // Obtener dueño del usuario logueado
  useEffect(() => {
    const usuario = JSON.parse(localStorage.getItem('usuario'));

    if (usuario && usuario.userId) {
      fetch(`${OWNER_BY_USER_API}/${usuario.userId}`)
        .then(res => {
          if (!res.ok) throw new Error('No se pudo obtener el dueño');
          return res.json();
        })
        .then(ownerData => {
          setFormData(prev => ({
            ...prev,
            owner: {
              ownerId: ownerData.ownerId
            }
          }));
        })
        .catch(err => {
          console.error('Error cargando el dueño:', err);
          setErrorMessage('Error al cargar información del dueño');
        });
    } else {
      setErrorMessage('Usuario no encontrado en sesión');
    }
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (!formData.owner || !formData.owner.ownerId) {
      setErrorMessage('No se encontró el dueño asociado al usuario.');
      return;
    }

    fetch(`${PET_API}/save`, {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(formData)
    })
      .then(res => {
        if (!res.ok) return res.text().then(text => { throw new Error(text); });

        setSuccessMessage('Mascota registrada correctamente');
        setErrorMessage('');
        setFormData({
          name: '',
          species: '',
          breed: '',
          birthDate: '',
          owner: {
            ownerId: formData.owner.ownerId // se conserva el dueño logueado
          }
        });
      })
      .catch(err => {
        console.error('Error al registrar mascota:', err);
        setErrorMessage('Error al registrar mascota');
        setSuccessMessage('');
      });
  };

  return (
    <div>
      <h2>Registrar Nueva Mascota</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Nombre:</label>
          <input name="name" value={formData.name} onChange={handleChange} required />
        </div>
        <div>
          <label>Especie:</label>
          <input name="species" value={formData.species} onChange={handleChange} required />
        </div>
        <div>
          <label>Raza:</label>
          <input name="breed" value={formData.breed} onChange={handleChange} required />
        </div>
        <div>
          <label>Fecha de nacimiento:</label>
          <input type="date" name="birthDate" value={formData.birthDate} onChange={handleChange} required />
        </div>

        {/* Dueño se asigna automáticamente. Esto puede mostrarse como texto opcional */}
        <div>
          <label>Dueño asignado:</label>
          <input type="text" value={formData.owner?.ownerId || 'Cargando...'} disabled />
        </div>

        <button type="submit">Registrar</button>
      </form>

      {successMessage && <p style={{ color: 'green' }}>{successMessage}</p>}
      {errorMessage && <p style={{ color: 'red' }}>{errorMessage}</p>}
    </div>
  );
}

export default PetForm;
